/** Alerts */
import AlertsErrors from './Alerts/Errors';

/** Menu */
import MenuInternal from './Menu/Internal';
import MenuExternal from './Menu/External';

/** Footer */
import FooterInternal from './Footer/Internal';
import FooterExternal from './Footer/External';

/** Loader */
import Loader from './Loader';

/** Modal */
import ModalTemplate from './Modal';

/** Forms */
import FormLogin from './Forms/Login';
import FormSendPhone from './Forms/RegisterData/SendPhone';
import FormRegisterData from './Forms/RegisterData/RegisterData';
import FormSuccessData from './Forms/RegisterData/SuccessData';
import FormValidatePincode from './Forms/RegisterData/ValidatePincode';
import FormSendEmail from './Forms/RecoveryPassword/SendEmail';
import FormSendPassword from './Forms/RecoveryPassword/SendPassword';
import FormSuccesslEmail from './Forms/RecoveryPassword/SuccessEmail';
import FormSuccessPassword from './Forms/RecoveryPassword/SuccessPassword';
import FormRegisterContributors from './Forms/RegisterContributos';
import FormRemoveContributors from './Forms/RemoveContributors';
import FormEditColaborators from './Forms/EditColaborators';

/** Exports Components */
export {
  AlertsErrors,
  Loader,
  ModalTemplate,
  MenuInternal,
  MenuExternal,
  FooterInternal,
  FooterExternal,
  FormLogin,
  FormSendEmail,
  FormSendPassword,
  FormSuccesslEmail,
  FormSuccessPassword,
  FormSendPhone,
  FormValidatePincode,
  FormRemoveContributors,
  FormRegisterData,
  FormSuccessData,
  FormRegisterContributors,
  FormEditColaborators,
};
